(324,1712922410,2,'BE',1,0,33,'tt_content','{\"oldRecord\":{\"header\":\"About us (copy 1)\",\"bodytext\":\"<h1>About us<\\/h1>\\r\\n<p>Welcome to our Oriental fusion restaurant, where East meets West in a culinary adventure. Our restaurant combines traditional Oriental flavors with modern techniques to create a unique dining experience. From our carefully crafted menu to our stylish and contemporary ambiance, we strive to provide our guests with an unforgettable dining experience. Join us and indulge in the flavors of the East, reimagined for the modern palate.<\\/p>\\r\\n<p><a class=\\\"btn btn-primary\\\" href=\\\"t3:\\/\\/page?uid=1\\\">Submit<\\/a><\\/p>\",\"space_before_class\":\"\",\"space_after_class\":\"\",\"l18n_diffsource\":\"{\\\"hidden\\\":\\\"\\\"}\"},\"newRecord\":{\"header\":\"\\u00dcber Uns\",\"bodytext\":\"<h1>\\u00dcber uns<\\/h1>\\r\\n<p><br \\/>Willkommen in unserem Oriental Fusion Restaurant, wo Ost auf West in einem kulinarischen Abenteuer trifft. Unser Restaurant vereint traditionelle orientalische Aromen mit modernen Techniken, um ein einzigartiges kulinarisches Erlebnis zu schaffen. Von unserem sorgf\\u00e4ltig zusammengestellten Men\\u00fc bis zu unserem stilvollen und zeitgen\\u00f6ssischen Ambiente bem\\u00fchen wir uns, unseren G\\u00e4sten ein unvergessliches kulinarisches Erlebnis zu bieten. Begleiten Sie uns und lassen Sie sich von den Aromen des Ostens verf\\u00fchren, neu interpretiert f\\u00fcr den modernen Gaumen.<\\/p>\\r\\n<p><a class=\\\"btn btn-primary\\\" href=\\\"t3:\\/\\/page?uid=1\\\">Mehr erfahren<\\/a><\\/p>\",\"space_before_class\":\"defaultspace\",\"space_after_class\":\"defaultspace\",\"l18n_diffsource\":\"{\\\"CType\\\":\\\"\\\",\\\"header\\\":\\\"\\\",\\\"header_layout\\\":\\\"\\\",\\\"header_position\\\":\\\"\\\",\\\"subheader\\\":\\\"\\\",\\\"bodytext\\\":\\\"\\\",\\\"image\\\":\\\"\\\",\\\"imageorient\\\":\\\"\\\",\\\"image_zoom\\\":\\\"\\\",\\\"space_before_class\\\":\\\"\\\",\\\"space_after_class\\\":\\\"\\\",